text377497.addInnerText('<div id=\"text377497\" aria-live=\"polite\" ><a id=\"text377497anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<table style=\"border-collapse:collapse;top:0px;position:absolute; border-spacing:0; width:100%; height:100%\">\n<tr>\n<td style=\"position: absolute;top:0px;left:0px;box-sizing:border-box;width:100%;vertical-align:top;height:100%;padding:5px\">\n<div style=\'height:100%;width:100%;overflow-y:hidden;overflow-x:hidden;\'>\n\n<p lang=\"en\"  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text377497Font2\"  >Your current security clearance must be appropriate to the level of classified material you need to access</span ><span class=\"text377497Font3\" style=\"background-color:transparent\" >\n</span ></p >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text377497Font2\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:15px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text377497CircleBulletFont7.png\'); padding-left:8px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text377497Font4\"  >Baseline:</span ><span class=\"text377497Font2\"  > Permits ongoing access up to PROTECTED information\n</span ></li >\n<li  class=\"text377497Font2\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:15px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text377497CircleBulletFont7.png\'); padding-left:8px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text377497Font4\"  >Negative Vetting Level 1:</span ><span class=\"text377497Font2\"  > Permits ongoing access to SECRET information\n</span ></li >\n<li  class=\"text377497Font2\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:15px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text377497CircleBulletFont7.png\'); padding-left:8px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text377497Font4\"  >Negative Vetting Level 2:</span ><span class=\"text377497Font2\"  > Permits ongoing access to TOP SECRET information\n</span ></li >\n<li  class=\"text377497Font2\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:15px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text377497CircleBulletFont7.png\'); padding-left:8px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text377497Font4\"  >Positive Vetting:</span ><span class=\"text377497Font2\"  > Permits access to resources at all classification levels, including certain types of caveat and codeword information\n</span ></li >\n</ul >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text377497Font2\"  >A security clearance is not required to access OFFICIAL or OFFICIAL: Sensitive information.</span ><span class=\"text377497Font5\" style=\"background-color:transparent\" >\n</span ></p >\n\n\n</div></td>\n</tr>\n</table>\n</div>\n');
